import React, {Component} from 'react'
import CreateQuiz from './mock-up-images/create_quiz.svg'

class header extends Component {
    // State 
    state = {}

    // Render 
    render () {
        return (
            <React.Fragment>
                {/* Header */}
                <img src={CreateQuiz} className="create-quiz"/>
            </React.Fragment>
        )
    }
}

export default header
